INSERT INTO `t_goods` VALUES ('1245', '323', '2017-08-15 11:56:17', '2017-08-15 11:55:30', '1', 'G01245', 'G01245-1502769330054-0.jpg', '<p style=\"margin-bottom: 0px; text-rendering: optimizeLegibility; font-feature-settings: \'kern\' 1; font-kerning: normal; color: rgb(153, 153, 153); font-family: &quot;Arial Normal&quot;, Arial; font-size: 14px;\"><span style=\"font-family: &quot;应用字体 Regular&quot;, 应用字体;\">&nbsp;&nbsp; 星巴克（Starbucks）是美国一家连锁咖啡公司的名称，1971年成立，是全球最大的咖啡连锁店，其总部坐落美国华盛顿州西雅图市。星巴克旗下零售产品包括30多款全球顶级的咖啡豆、手工制作的浓缩咖啡和多款咖啡冷热饮料、新鲜美味的各式糕点食品以及丰富多样的咖啡机、咖啡杯等商品。星巴克在全球范围内已经有近21300间分店遍布北美、南美洲、欧洲、中东及太平洋区。2012年3月，星巴克在美国的两款甜点被曝用胭脂虫当着色剂，专家称或令哮喘者过敏。2012年4月，星巴克表示停用该着色剂。</span></p><p style=\"margin-bottom: 0px; text-rendering: optimizeLegibility; font-feature-settings: \'kern\' 1; font-kerning: normal; color: rgb(153, 153, 153); font-family: &quot;Arial Normal&quot;, Arial; font-size: 14px;\"><span style=\"font-family: &quot;应用字体 Regular&quot;, 应用字体;\">&nbsp;&nbsp; &nbsp; &nbsp; 星巴克（Starbucks）是美国一家连锁咖啡公司的名称，1971年成立，是全球最大的咖啡连锁店，其总部坐落美国华盛顿州西雅图市。星巴克旗下零售产品包括30多款全球顶级的咖啡豆、手工制作的浓缩咖啡和多款咖啡冷热饮料、新鲜美味的各式糕点食品以及丰富多样的咖啡机、咖啡杯等商品。星巴克在全球范围内已经有近21300间分店遍布北美、南美洲、欧洲、中东及太平洋区。2012年3月，星巴克在美国的两款甜点被曝用胭脂虫当着色剂，专家称或令哮喘者过敏。2012年4月，星巴克表示停用该着色剂。</span></p>', '星巴克', '66.00', '', '', '测试供货商zs', '746', '62.00', '60.00');
